--  DDL for Trigger LOC_CHANGE
--------------------------------------------------------

  CREATE OR REPLACE NONEDITIONABLE TRIGGER "NUREKE"."LOC_CHANGE" 
before update on Donors
for each row
 WHEN (NEW.address_id != OLD.address_id) declare 
  
begin
    dbms_output.put_line('Old location : '|| :OLD.address_id);
    dbms_output.put_line('New location : '|| :NEW.address_id);
end;


/
ALTER TRIGGER "NUREKE"."LOC_CHANGE" ENABLE;
--------------------------------------------------------
--  DDL for Trigger DESEASE_TRG
--------------------------------------------------------

  CREATE OR REPLACE NONEDITIONABLE TRIGGER "NUREKE"."DESEASE_TRG" 
before insert on Donors
for each row
 WHEN (NEW.donor_id > 0) begin
    if :NEW.MEDICAL_CONDITION = 1 then
        dbms_output.put_line('donor with disease!');
        delete from Donors where donor_id = :NEW.donor_id;
    end if;
end;



/
ALTER TRIGGER "NUREKE"."DESEASE_TRG" ENABLE;
